 $scope.compareItems = function(){
$.each(lookup,function(i,item){
    var bm = -1;
    var cae= -1;
    var name = "fail";
  var url = "https://www.albion-online-data.com/api/v2/stats/prices/"+item+"?locations=Caerleon,Blackmarket";
  $.getJSON( url, {
    format: "json"
  })
    .done(function( data ) {
        $.each( data, function( i, item ) 
        {
        if(item.city == "Black Market"){ bm = item.buy_price_max;}
        if (item.city == "Caerleon"){ cae = item.sell_price_min;}
        name = item.item_id;
        });

        if(bm!= -1 && cae != -1)
        {
            var note = {};
            note.bm = bm;
            note.cae = cae;
            note.name = name;
            note.profit = bm-cae;
            if(note.profit >0 && bm>0 && cae > 0)
            {
            console.log(note.name+ " " + note.profit)
            $scope.items.push(note);
            console.log($scope.items);
            $scope.$apply();
            }
            
        }
        else{
          $( ".remove" ).append( "<p>"+item+"</p>" );
        }
    });
});//each lookup
}
